VALUES ('3021990076353', 'Pate à pizza', 'Farine 19% (farine de blé, gluten, acide ascorbique, enzymes : hemicellulase et amylase fongiques), eau 6%, graines de sésame décortiquées, levure de panification, saccharomyces cerevisiae (levure de boulanger, saccharomyces cerevisiae, eau) sel fin sèche (sel, antiaglomérant E535)', 'https://static.openfoodfacts.org/images/products/302/199/007/6353/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3021990076469', 'Chinois pepites de chocolat', 'Chinois aux pépites de chocolat. inqredients: pate a brioche ( farine (farine de BLE - sucre - poudre au BEURRE (BEURRE 90%, proteines de LAIT, permeat de LACTOSERUM, emulsifiant e471, antioxyqenes e304 e307 (SOJA)) - sel - emulsifiants e472e e471 - GLUTEN de BLE - stabilisant e466 - arôme - agent de traitement de ta farine e300 - colorant e160aii - enzyme teneur en poids de matiere grasse provenant du LAIT : formule a - article 4 regiement (ce) n01898/2005), OEUF (OEUF entier), eau 18%, levure (saccharomyces cerevisiaet sel, goutte de chocolat (sucre, de cacao, beurre de cacao, ernulsifiant : lecithine de arôme vanille.)', 'https://static.openfoodfacts.org/images/products/302/199/007/6469/front_fr.4.400.jpg', '1', '1', '1', '1', '', '1', '1', '0.393700787401575', '', '1');

