VALUES ('3021990076476', 'Chausson aux Pommes', 'Chausson 93 % (pâte 63 % : farine de BLÉ, BEURRE 37 %, eau, sel. Dorure ; ŒUFS. Compote 37 % (purée de pommes 85 %, sirop de glucose-fructose (BLÉ ou maïs), sucre, antioxygène : E300).', 'https://static.openfoodfacts.org/images/products/302/199/007/6476/front_fr.6.400.jpg', '', '', '', '', '', '', '', '', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3021990076551', 'Beignet  Bretzel  natures au sucre (x4)', 'Beignets bretzel cuit 32 % farine de BLÉ, huile et matière grasse végétales partiellement hydrogénées: palme et colza, ŒUF entier, eau, levure, sucre, LACTOSE, émulsifiants: E322; E471; E472e, poudre de LACTOSERUM, maltodextrine, sel iode, poudre de blanc d\'ŒUF, GLUTEN de BLÉ, arôme, extrait de curcumine et de carotte, acidifiant: E330, colorant: E160a. Décor : sucre, cannelle.', 'https://static.openfoodfacts.org/images/products/302/199/007/6551/front_fr.8.400.jpg', '1', '1', '1', '1', '', '1', '1', '0.393700787401575', '', '1');

